import './App.css';
import Header from './Component/Header/Header'

class App extends Component{


state = {
  veg:[
    {name: "sprout", age: 2},
    {name: "soy bean", age: 6},
    {name: "spinach", age: 4},
  ]
}









  render(){
    return (
      <div className="App">
         <h1>野菜チャット</h1>
         <Header name = 'Cabbage' age='3'/>
         <Header name = 'Broccoli' age='5'/>
         <Header name = 'Baby Carrot' age='2'/>
         <Header name = {this.state.veg[0].name} age ={this.state.veg[0].age}/>
         <Header name = {this.state.veg[1].name} age ={this.state.veg[1].age}/>
         <Header name = {this.state.veg[2].name} age ={this.state.veg[2].age}/>

      </div>
    );
  }

}



